#goALOfnewyou - Day 5 - Being true to yourself.

Recently, after teaching a busy yoga class, one of my students said some very nice things about my classes and my teaching. He was being so complimentary that I was almost embarrassed. I pointed out that although my class was full (25 students), I have never been the Los Angeles/Hollywood teacher who has classes with hundreds of people in them. I have never been the most popular teacher. We sat in silence for a moment and then my student says, “well, you don’t want to be the Taylor Swift of yoga teachers. You are the great indie rock band of yoga teachers.” 

I make choices and act in ways that are not always the most popular as a yoga teacher or Instagram user. I’ll never have 100 student classes or 100k followers. I’m not that teacher. That’s not me. I love making shapes and climbing walls. I love poses that aren’t traditional yoga poses. I love teaching yoga philosophy themes in my classes. I love being inspired by Star Wars and Spider-Man. I love pushing my students to their limits, calling them out by name, and teaching them that they can do more than they thought possible. I wouldn’t mind being Taylor Swift, just not at the expense of being true to myself.

