#goALOfnewyou - Day 6 - Being nice to yourself.

Being nice to myself is pausing, taking a breath, and resting without feeling guilty for doing less. It is taking child’s pose in the middle of an active yoga class. It is listening to my body, mind, and heart and giving myself the time and space to be calm, quiet, and at peace.

