#goALOfnewyou - Day 7 - Setting healthy boundaries. 

For me, setting healthy boundaries means clearly defining roles and knowing when to say “no.” In my yoga classes, I am a teacher, not a babysitter, not a drill sergeant, not a cheerleader. I set strong boundaries in my class. Do the poses and actions that I am teaching to the best of your ability. Of course, there is room for modification and variation, depending on your ability, skill, and level of fitness. But please skip my class if you don’t want to listen to my instructions or just want to do your own thing.

