#goalofnewyou - Day 8 - Forgiving yourself when you aren't being true or nice to yourself.

When I need to forgive myself for losing sight of what’s important, not being true to myself, or not taking care of myself, I pause, close my eyes, get on my yoga mat, and sit (sometimes upside down) with myself. I observe from the highest vantage point, which is consciousness, and everything falls back into place. I realize what is truly important, take care of myself again, and all is forgiven.

Thank you to everyone who participated in this challenge and shared your self-care practices! It was great to get to know you beyond a few yoga photos!

